	/**
	 * Returns all keywords of the grammar. This includes all literals for boolean and
	 * enumeration terminals.
	 */
	public java.util.Set<String> getKeywords() {
		if (this.keywords == null) {
			this.keywords = new java.util.LinkedHashSet<String>();
			for (org.emftext.language.gbind.resource.gbind.grammar.GbindRule rule : RULES) {
				findKeywords(rule, this.keywords);
			}
		}
		return keywords;
	}
	
	/**
	 * Finds all keywords in the given element and its children and adds them to the
	 * set. This includes all literals for boolean and enumeration terminals.
	 */
	private void findKeywords(org.emftext.language.gbind.resource.gbind.grammar.GbindSyntaxElement element, java.util.Set<String> keywords) {
		if (element instanceof org.emftext.language.gbind.resource.gbind.grammar.GbindKeyword) {
			keywords.add(((org.emftext.language.gbind.resource.gbind.grammar.GbindKeyword) element).getValue());
		} else if (element instanceof org.emftext.language.gbind.resource.gbind.grammar.GbindBooleanTerminal) {
			keywords.add(((org.emftext.language.gbind.resource.gbind.grammar.GbindBooleanTerminal) element).getTrueLiteral());
			keywords.add(((org.emftext.language.gbind.resource.gbind.grammar.GbindBooleanTerminal) element).getFalseLiteral());
		} else if (element instanceof org.emftext.language.gbind.resource.gbind.grammar.GbindEnumerationTerminal) {
			org.emftext.language.gbind.resource.gbind.grammar.GbindEnumerationTerminal terminal = (org.emftext.language.gbind.resource.gbind.grammar.GbindEnumerationTerminal) element;
			for (String key : terminal.getLiteralMapping().keySet()) {
				keywords.add(key);
			}
		}
		for (org.emftext.language.gbind.resource.gbind.grammar.GbindSyntaxElement child : element.getChildren()) {
			findKeywords(child, this.keywords);
		}
	}
	
